// SPDX-License-Identifier: Unlicense
pragma solidity ^0.8.24;

import "../libraries/SafeERC20.sol";
import "../proxy/ProxyStorage.sol";

import { AccessibleCommon } from "../common/AccessibleCommon.sol";
import { L2toL2CrossTradeStorage } from "./L2toL2CrossTradeStorage.sol";
import { IOptimismMintableERC20, ILegacyMintableERC20 } from "../interfaces/IOptimismMintableERC20.sol";
import { IL2CrossDomainMessenger } from "../interfaces/IL2CrossDomainMessenger.sol";
import { ReentrancyGuard } from "../utils/ReentrancyGuard.sol";

// import "hardhat/console.sol";

contract L2toL2CrossTradeL2 is ProxyStorage, AccessibleCommon, L2toL2CrossTradeStorage, ReentrancyGuard {

    using SafeERC20 for IERC20;

    event RequestCT(
        address _l1token,
        address _l2SourceToken,
        address _l2TargetToken,
        address _requester,
        uint256 _totalAmount,
        uint256 _ctAmount,
        uint256 indexed _saleCount,
        uint256 _l1ChainId,
        uint256 _l2SourceChainId,
        uint256 _l2TargetChainId,
        bytes32 _hashValue
    );

    event NonRequestCT(
        address _l1token,
        address _l2SourceToken,
        address _l2TargetToken,
        address _requester,
        uint256 _totalAmount,
        uint256 _ctAmount,
        uint256 indexed _saleCount,
        uint256 _l1ChainId,
        uint256 _l2SourceChainId,
        uint256 _l2TargetChainId,
        bytes32 _hashValue
    );

    event ProviderClaimCT(
        address _l1token,
        address _l2SourceToken,
        address _l2TargetToken,
        address _requester,
        address _provider,
        uint256 _totalAmount,
        uint256 _ctAmount,
        uint256 indexed _saleCount,
        uint256 _l1ChainId,
        uint256 _l2SourceChainId,
        uint256 _l2TargetChainId,
        bytes32 _hash
    );

    event CancelCT(
        address _requester,
        uint256 _totalAmount,
        uint256 indexed _saleCount,
        uint256 _l1ChainId,
        uint256 _l2SourceChainId,
        uint256 _l2TargetChainId,
        bytes32 _hash
    );

    // event EditCT(
    //     address _requester,
    //     uint256 _ctAmount,
    //     uint256 indexed _saleCount
    // );

    //=======modifier========

    modifier onlyEOA() {
        require(msg.sender == tx.origin, "L2FW: function can only be called from an EOA");
        _;
    }

    modifier checkL1(uint256 _chainId) {
        require(
            msg.sender == address(crossDomainMessenger) && IL2CrossDomainMessenger(crossDomainMessenger).xDomainMessageSender() == chainData[_chainId].l1CrossTradeContract, 
            "only call l1FastWithdraw"
        );
        _;
    }

    modifier providerCheck(uint256 _saleCount) {
        require(dealData[_saleCount].provider == address(0), "already sold");
        _;
    }

    modifier nonZero(uint256 _amount) {
        require(_amount > 0 , "input amount need nonZero");
        _;
    }

    // modifier nonZeroAddr(address _addr) {
    //     require(_addr != address(0) , "nonZeroAddr");
    //     _;
    // }

    //=======external========

    /// @notice Register L1token and L2token and use them in requestRegisteredToken
    /// @param _l1token l1token Address
    /// @param _l2SourceToken _l2SourceToken Address
    /// @param _l2TargetToken _l2TargetToken Address
    /// @param _l1ChainId chainId of l1token
    /// @param _l2SourceChainId chainId of l2Source
    /// @param _l2TargetChainId chainId of l2Target
    function registerToken(
        address _l1token,
        address _l2SourceToken,
        address _l2TargetToken,
        uint256 _l1ChainId,
        uint256 _l2SourceChainId,
        uint256 _l2TargetChainId

    )
        external
        onlyOwner
    {
        bytes32 id = keccak256(abi.encode(
            _l1ChainId,
            _l2SourceChainId,
            _l2TargetChainId,
            _l1token,
            _l2SourceToken,
            _l2TargetToken
        ));
        require(registerCheck[id] == false, "already registerToken");
        registerCheck[id] = true;
    }

    /// @notice Register L1token and L2token and use them in requestRegisteredToken
    /// @param _l1token l1token Address
    /// @param _l2SourceToken _l2SourceToken Address
    /// @param _l2TargetToken _l2TargetToken Address
    /// @param _l1ChainId chainId of l1token
    /// @param _l2SourceChainId chainId of l2Source
    /// @param _l2TargetChainId chainId of l2Target
    function deleteToken(
        address _l1token,
        address _l2SourceToken,
        address _l2TargetToken,
        uint256 _l1ChainId,
        uint256 _l2SourceChainId,
        uint256 _l2TargetChainId
    )
        external
        onlyOwner
    {
        bytes32 id = keccak256(abi.encode(
            _l1ChainId,
            _l2SourceChainId,
            _l2TargetChainId,
            _l1token,
            _l2SourceToken,
            _l2TargetToken
        ));
        require(registerCheck[id] != false, "already deleteToken");
        registerCheck[id] = false;
    }

    /// @notice Token transaction request registered in register
    /// @param _l1token l1token Address
    /// @param _l2SourceToken _l2SourceToken Address
    /// @param _l2TargetToken _l2TargetToken Address
    /// @param _totalAmount Amount provided to L2
    /// @param _ctAmount Amount to be received from L1
    /// @param _l1ChainId chainId of l1token
    /// @param _l2TargetChainId chainId of l2TargetToken
    function requestRegisteredToken(
        address _l1token,
        address _l2SourceToken,
        address _l2TargetToken,
        uint256 _totalAmount,
        uint256 _ctAmount,
        uint256 _l1ChainId,
        uint256 _l2TargetChainId
    )
        external
        payable
        onlyEOA
        nonZero(_totalAmount)
        nonZero(_ctAmount)
        nonReentrant
    {

        uint256 _l2SourceChainId = _getChainID();
        bytes32 id = keccak256(abi.encode(
            _l1ChainId,
            _l2SourceChainId,
            _l2TargetChainId,
            _l1token,
            _l2SourceToken,
            _l2TargetToken
        ));

        require(registerCheck[id] == true, "not register token");
        require(_totalAmount >= _ctAmount, "The totalAmount value must be greater than ctAmount");

        unchecked {
            ++saleCount;
        }

        bytes32 hashValue = _request(
            _l1token,
            _l2SourceToken,
            _l2TargetToken,
            _totalAmount,
            _ctAmount,
            saleCount,
            _l1ChainId,
            _l2TargetChainId
        );


        emit RequestCT(
            _l1token,
            _l2SourceToken,
            _l2TargetToken,
            msg.sender,
            _totalAmount,
            _ctAmount,
            saleCount,
            _l1ChainId,
            _l2SourceChainId,
            _l2TargetChainId,
            hashValue
        );
    }

    /// @notice Token transaction request not registered in register
    /// @param _l1token l1token Address
    /// @param _l2SourceToken _l2SourceToken Address
    /// @param _l2TargetToken _l2TargetToken Address
    /// @param _totalAmount Amount provided to L2
    /// @param _ctAmount Amount to be received from L1
    /// @param _l1ChainId chainId of l1token
    /// @param _l2TargetChainId chainId of l2TargetToken
    function requestNonRegisteredToken(
        address _l1token,
        address _l2SourceToken,
        address _l2TargetToken,
        uint256 _totalAmount,
        uint256 _ctAmount,
        uint256 _l1ChainId,
        uint256 _l2TargetChainId
    )
        external
        payable
        onlyEOA
        nonZero(_totalAmount)
        nonZero(_ctAmount)
        nonReentrant
    {     

        uint256 _l2SourceChainId = _getChainID();
        unchecked {
            ++saleCount;
        }

        bytes32 hashValue = _request(
            _l1token,
            _l2SourceToken,
            _l2TargetToken,
            _totalAmount,
            _ctAmount,
            saleCount,
            _l1ChainId,
            _l2TargetChainId
        );

        emit NonRequestCT(
            _l1token,
            _l2SourceToken,
            _l2TargetToken,
            msg.sender,
            _totalAmount,
            _ctAmount,
            saleCount,
            _l1ChainId,
            _l2SourceChainId,
            _l2TargetChainId,
            hashValue
        );

    }


    // // this is the message the TargetContract is waiting for from L1.
    // function handleDepositL1CT(){
    //     address _from,
    //     uint256 _ctAmount, 
    //     uint256 _salecount,
    //     uint256 _l1ChainId,
    //     uint256 _l2SourceChainId,
    //     bytes32 _hash
    // }
    //     external
    //     nonReentrant
    //     checkL1(_l1ChainId)
    //     providerCheck(_salecount)
    // {
    //     require(dealData[_saleCount].hashValue == _hash, "Hash values do not match");

    // }

    /// @notice When providing a function called from L1, the amount is given to the provider.
    /// @param _from provider Address
    /// @param _ctAmount Amount paid by L1
    /// @param _saleCount Number generated upon request
    /// @param _l1ChainId chainId of l1token
    /// @param _l2TargetChainId chainId of l2Target
    /// @param _hash Hash value generated upon request
    function claimCT(
        address _from,
        uint256 _ctAmount,
        uint256 _saleCount,
        uint256 _l1ChainId,
        uint256 _l2TargetChainId,
        bytes32 _hash
    )
        external
        nonReentrant
        checkL1(_l1ChainId)
        providerCheck(_saleCount)
    {
        require(dealData[_saleCount].hashValue == _hash, "Hash values do not match");

        uint256 ctAmount = _ctAmount;
        if(_ctAmount == 0) {
            ctAmount = dealData[_saleCount].ctAmount;
        } 

        dealData[_saleCount].provider = _from;
        address l2SourceToken = dealData[_saleCount].l2SourceToken;
        uint256 totalAmount = dealData[_saleCount].totalAmount;

        if(l2SourceToken == legacyERC20ETH) {
            (bool sent, ) = payable(_from).call{value: totalAmount}("");
            require(sent, "claim fail");
        } else {
            IERC20(l2SourceToken).safeTransfer(_from,totalAmount);
        }

        uint256 _l2SourceChainId = _getChainID();



    }

    /// @notice When canceling a function called from L1, the amount is given to the requester.
    /// @param _msgSender Address where cancellation was requested
    /// @param _salecount Number generated upon request
    /// @param _l1ChainId chainId of l1token
    /// @param _l2TargetChainId chainId of l2Target
    /// @param _hash Hash value generated upon request
    function cancelCT(
        address _msgSender,
        uint256 _salecount,
        uint256 _l1ChainId,
        uint256 _l2TargetChainId,
        bytes32 _hash
    )
        external
        nonReentrant
        checkL1(_l1ChainId)
        providerCheck(_salecount)
    {
        require(dealData[_salecount].requester == _msgSender, "your not seller");
        require(dealData[_salecount].hashValue == _hash, "Hash values do not match");

        dealData[_salecount].provider = _msgSender;
        uint256 totalAmount = dealData[_salecount].totalAmount;

        if (dealData[_salecount].l2SourceToken == legacyERC20ETH) {
            (bool sent, ) = payable(_msgSender).call{value: totalAmount}("");
            require(sent, "cancel refund fail");
        } else {
            IERC20(dealData[_salecount].l2SourceToken).safeTransfer(_msgSender,totalAmount);
        }

        uint256 _l2SourceChainId = _getChainID();

        emit CancelCT(
            _msgSender, 
            totalAmount, 
            _salecount,
            _l1ChainId,
            _l2SourceChainId,
            _l2TargetChainId,
            _hash
        );

    }


    /// @notice Function that calculates hash value in L2CrossTradeContract
    /// @param _l1token l1token Address
    /// @param _l2SourceToken l2SourceToken Address
    /// @param _l2TargetToken l2TargetToken Address
    /// @param _requestor requester's address
    /// @param _totalAmount Amount provided to L2
    /// @param _ctAmount Amount provided to L2
    /// @param _saleCount Number generated upon request
    /// @param _l1ChainId Destination chainID
    /// @param _l2SourceChainId The chainId where this contract was deployed
    /// @param _l2TargetChainId The chainId where this contract was deployed
    function getHash(
        address _l1token,
        address _l2SourceToken,
        address _l2TargetToken,
        address _requestor,
        uint256 _totalAmount,
        uint256 _ctAmount,
        uint256 _saleCount,
        uint256 _l1ChainId,
        uint256 _l2SourceChainId,
        uint256 _l2TargetChainId
    )
        public
        pure
        returns (bytes32)
    {
        return keccak256(
            abi.encode(
                _l1token, 
                _l2SourceToken,
                _l2TargetToken,
                _requestor, 
                _totalAmount, 
                _ctAmount, 
                _saleCount, 
                _l1ChainId,
                _l2SourceChainId,
                _l2TargetChainId
            )
        );
    }

    // //=======Temporary view for testing ========
    // function getChainID() public view returns (uint256 id) {
    //     assembly {
    //         id := chainid()
    //     }
    // }

    //=======internal========

    /// @notice Function to calculate l1token, l2token register hash value
    function _getChainID() private view returns (uint256 id) {
        assembly {
            id := chainid()
        }
    }

    /// @notice Token transaction request
    /// @param _l1token l1token Address
    /// @param _l2SourceToken l2SourceToken Address
    /// @param _l2TargetToken l2TargetToken Address
    /// @param _totalAmount Amount provided to L2
    /// @param _ctAmount Amount to be received from L1
    /// @param _saleCount Number generated upon request
    /// @param l1ChainId chainId of l1token
    /// @param l2TargetChainId chainId of l2TargetToken

    function _request(
        address _l1token,
        address _l2SourceToken,
        address _l2TargetToken,
        uint256 _totalAmount,
        uint256 _ctAmount,
        uint256 _saleCount,
        uint256 l1ChainId,
        uint256 l2TargetChainId
    )
        private
        returns (bytes32 hashValue)
    {
        if (_l2SourceToken == legacyERC20ETH) {
            require(msg.value == _totalAmount, "CT: nativeTON need amount");
        } else {
            IERC20(_l2SourceToken).safeTransferFrom(msg.sender,address(this),_totalAmount);
        }

        uint256 l2SourceChainId = _getChainID();

        hashValue = getHash(
            _l1token,
            _l2SourceToken,
            _l2TargetToken,
            msg.sender,
            _totalAmount,
            _ctAmount,
            _saleCount,
            l2SourceChainId,
            l2TargetChainId,
            l1ChainId
        );

        dealData[_saleCount] = RequestData({
            l1token: _l1token,
            l2SourceToken: _l2SourceToken,
            l2TargetToken: _l2TargetToken,
            requester: msg.sender,
            provider: address(0),
            totalAmount: _totalAmount,
            ctAmount: _ctAmount,
            l1ChainId: l1ChainId,
            l2TargetChainId: l2TargetChainId,
            hashValue: hashValue
        });

    }
}

